import React from 'react';

import { Meta } from '../layout/Meta';
import { Main } from '../templates/Main';
import  Map from '../pages';

const location = {
  address: '1600 Amphitheatre Parkway, Mountain View, california.',
  lat: 37.42216,
  lng: -122.08427,
} // our location object from earlier

const Position = () => (
  <Main meta={<Meta title="Dove siamo" description="Dove siamo" />}>
      <img
        src={`${process.env.baseUrl}/assets/images/autofficina-banner8
        .png`}
        alt="Autofficina"
      />
    <p className="text-sm">
      <h1 className="my-8 font-bold">Indirizzo
      <span role="img" aria-label="home">🏠</span>
      </h1>
      <ul>
        <li>
          Via Stradona, 808
        </li>
        <li>35040 Merlara (PD)</li>
      </ul>
      <h1 className="font-bold">Ti aspettiamo!</h1>
      </p>
      <Map /> {/* include it here */}
  </Main>
);

export default Position;
